import React, { useState } from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import ListStg from './ListStg';
import AjouterStg from './AjouterStg';

const AppF = () => {
    const [liststg,setliststg]=useState([])
    const [id,setId]=useState(0)
   // function ajouterstg(nouveauStg){
      //  setliststg([...liststg,nouveauStg])
   }
   function ajouterstg(nouveauStg) {
    setliststg([...liststg, { ...nouveauStg, id: id }]);
    setId(id + 1);
    // }
    return (
        <>
          <BrowserRouter>
            <Routes>
                <Route path='/' element={<ListStg liststg={liststg} />}/>
                <Route path='/AjouterStagiaire' element={<AjouterStg ajouterstg={ajouterstg} id={id}/>}/>
                
                
            </Routes>
          </BrowserRouter>  
        </>
    );
}

export default AppF;
